import { useDispatch } from 'react-redux';
import { getAllOrders } from '../../actions/orderAction';

const Orderlist = () => {

  const dispatch=useDispatch()
  useEffect(() => {


    dispatch(getAllOrders())
  },[dispatch])

 
  return (
    <div><h1>Orderlist</h1></div>
  )
}

export default Orderlist;
